import React from 'react'

function HouseRenovationIdeas() {
  return (
    <div background-color="black" class="max-w-md mx-auto bg-white rounded-xl shadow-md overflow-hidden md:max-w-2xl">
      <div class="md:flex">
        <div class="md:shrink-0">
          <img src="https://3ejgjd41qtccawse34f6koz1-wpengine.netdna-ssl.com/wp-content/uploads/2015/07/Zoller_e.jpg" alt="House Remodel Tip" class="h-48 w-full object-cover md:h-full md:w-48"></img>
        </div>
        <div class="p-8">
          <h3 class="uppercase tracking-wide text-sm text-yellow-400 font-semibold">Upgrade the Front Door Area</h3>
          <p color="#e9e9e9" class="mt-2" >Don’t underestimate the power of a front door. People make up their minds in the first seven seconds of entering a house,” says ERA broker Kristin Willens. The front door is the primary and ultimate transition space of your home. It’s also a critical part of any visitor’s first impression. Spruce up this exterior entry by painting your front door, upgrading your house numbers, replacing your front porch light fixture, tossing down a new door mat, or simply conducting a thorough overall cleaning of the front of your home. Why? Because “a welcoming entrance will definitely increase your home’s bottom line” – Diynetwork.</p>
        </div>



      </div>
    </div>
  )
}

export default HouseRenovationIdeas

